// import React from "react";

import { useState } from "react";
import "./App.css";
import { Select } from "./components/Select";

const options = [
  {
    label: "First",
    value: 1,
  },
  {
    label: "second",
    value: 2,
  },
  {
    label: "third",
    value: 3,
  },
  {
    label: "fourth",
    value: 4,
  },
];

function App() {
  const [value, setValue] = useState(options[0]);
  return (
    <div className="App">
      <h1>Input project</h1>
      <Select
        options={options}
        value={value}
        onChange={function (
          value: { label: string; value: any } | undefined
        ): void {
          throw new Error("Function not implemented.");
        }}
      />
    </div>
  );
}

export default App;
